import React from 'react'
import './menu.css';

function Menu() {
  return (
    <div className="menu">
        <nav>
            <ul>
                <li><a href="#">All</a></li>
                <li><a href="#">Board</a></li>
                <li><a href="#">Graph</a></li>
                <li><a href="#">Recent</a></li>
            </ul>
        </nav>
        <div className="menucontainer">
        <input type="text" placeholder="DFIN"></input>
        </div>
    </div>
  );
}

export default Menu;
